import React, { Component } from 'react';
import Geocode from "react-geocode";

const geocodeParams = {
  apiKey: 'AIzaSyDTkNdUuexN_PZOKtezyqWdO-g3-ewhHiQ',
  language: 'vn',
  region: 'Vietnam'
}

// Geocode.fromAddress(
