export default class GoogleMap extends Component {

  getAddressText() {
    Geocode.fromLatLng(
      "10.777919",
      "106.691867",
      geocodeParams.apiKey,
      geocodeParams.language,
      geocodeParams.region
    ).then(
      response => {
        const address = response.results[0].formatted_address;
        console.log(address);
      },
      error => {
        console.error(error);
      }
    );
  }

  render() {
    this.getAddressText();
    return (
      <div>
        GoogleMap
      </div>
    )
  }
}
